import React, { useState } from "react";
import { useParams } from "react-router-dom";

function Prod() {
  // const [products, setProducts] = useState([]);
  const { categoryName } = useParams();

  // const fetchData = () => {
  //   fetch("http://localhost:3000/actualProduct")
  //     .then((response) => response.json())
  //     .then((jsonData) => setProducts(jsonData));
  // };
  const products = [
    { id: 1, name: "Товар 1" },
    { id: 2, name: "Товар 2" },
    { id: 3, name: "Товар 3" },
  ];
  return (
    <div>
      <h1>Список товаров: {categoryName}</h1>
      <ul>
        {products.map((procut) => {
          <li>{procut.name}</li>;
        })}
      </ul>
    </div>
  );
}

export default Prod;
